import React,{Component} from 'react';
import logo from "./img/logoxirkawarna.png"

export default class Laporan extends Component{
    render(){
        return (
        <div>
            <div className="box-footer"> 
                <div>
                    <img className="homexirka" src={logo}/> 
                </div>
                <div>HOME</div>
            </div>
        </div>
        )
    } 
}
